import React from 'react';

function card(props) {
   let info=props.info;

  return (
    <div>

    <div className='w-[40%] mx-auto bg-slate-300 relative m-4'>
    
       <div className=''>
       <div >
            {info.name}
        </div>
        <div>
            {info.job}
        </div>
        <div className='text-sm'>
            {info.text}
        </div>
       </div>
    </div>

    </div>
  )
}

export default card
